    class ParameterCode
    {
        public static string getParameterGroup (string code)
        {
            string group = null;
            ParameterData parameterData = getParameterData (code);
            if (parameterData != null)
            {
                group = parameterData.Group;
            }
            return group;
        }

        public static string getParameterName (string code)
        {
            string name = null;
            ParameterData parameterData = getParameterData (code);
            if (parameterData != null)
            {
                name = parameterData.Name;
            }
            return name;
        }

        public static string getParameterUnits (string code)
        {
            string units = null;
            ParameterData parameterData = getParameterData (code);
            if (parameterData != null)
            {
                units = parameterData.Units;
            }
            return units;
        }

        private class ParameterData
        {
            public ParameterData (string group, string name, string units)
            {
                Group = group;
                Name = name;
                Units = units;
            }
            public string Group { get; set; }
            public string Name { get; set; }
            public string Units { get; set; }
        }

        private static ParameterData getParameterData (string code)
        {
            if (String.IsNullOrEmpty(code) == false)
            {
                using (StringReader stringReader = new StringReader(UsgsWaterDataResources.parameterCodes))
                {
                    string line;
                    while ((line = stringReader.ReadLine ()) != null)
                    {
                        string [] data = line.Split ('\t');
                        if (data.Length == 4 && data[0].Trim() == code)
                        {
                            return new ParameterData(data[1], data[2], data[3]);
                        }
                    }
                }
            }
            return null;
        }

